import React from "react";
import { Link } from "react-router-dom";

const Menu = () =>{
    return(
        <>
        <div className="header">
        
            <Link to='/'>About </Link>
            <Link to='/1'>About </Link>
            <Link to='/2'>About </Link>
        </div>
        </>
    );
};
export default Menu;
